create table biz_financial_records
(
    id               bigint         not null comment '主鍵ID'
        primary key,
    transaction_date datetime       not null comment '交易时间',
    transaction_type varchar(10)    not null comment '交易类型',
    amount           decimal(12, 2) not null comment '金额',
    category_code    varchar(255)   null comment '分类编码',
    account_name     varchar(255)   null comment '账户名称',
    remark           varchar(255)   null comment '备注',
    currency         char(3)        not null comment '货币类型',
    tags_id          int            null comment '标签Id',
    ledger_book_name varchar(255)   null comment '账本名称',
    location         varchar(255)   null comment '位置',
    refund           decimal(12, 2) null comment '退款金额',
    image_urls       varchar(255)   null comment '图片附件数组',
    create_id        bigint         null comment '创建者',
    create_time      datetime       null comment '创建时间',
    update_id        bigint         null comment '修改人',
    update_time      datetime       null comment '修改时间'
)
    comment '财务管理主表' row_format = DYNAMIC;

